CREATE MATERIALIZED VIEW stream_query AS SELECT tumble_0.city AS col_0, tumble_0.city AS col_1 FROM tumble(person, person.date_time, INTERVAL '67') AS tumble_0 WHERE true GROUP BY tumble_0.city;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
